// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// Import the specific icons
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faBreadSlice, faBowlRice, faPaintRoller, faPlugCircleBolt, faFaucetDrip,   } from '@fortawesome/free-solid-svg-icons';

// Add the loaded icons to the library
library.add(fab, faBreadSlice, faBowlRice, faPaintRoller, faPlugCircleBolt, faFaucetDrip,  );
